import React from "react";
import Navbar from "react-bootstrap/Navbar";



const SearchBar = () => {
    return(
    <Navbar bg="dark" variant="dark">
        <Navbar.Brand href="#home">
        <img
            alt=""
            src="/logo-symbol.svg"
            width="30"
            height="30"
            className="d-inline-block align-top"
        />
        </Navbar.Brand>
    </Navbar>


    )
}

export default SearchBar;
